import React, {FC, memo} from 'react';

import classes from './Flight.module.scss';

interface Props {
	key: string;
	index: number;
}

const Flight: FC<Props> = memo(({key, index}) => {
	return (
		<div className={classes.wrapper} key={key}>
			<div className={classes.segment}>
				<p>Эррайвл</p>
				<p></p>
			</div>
			<div className={classes.segment}>
				<p>Депарча</p>
				<p></p>
			</div>
			<div className={classes.segment}>продолжительность остановки</div>
			<div className={classes.segment}>Время в пути</div>
			<div className={classes.segment}>Фулл маршрут</div>
		</div>
	);
});

export default Flight;
